import React, {Component} from 'react'

class StarshipList extends Component {
    render() {
        const shipList = this.props.ships.map((s, idx) => {
        return <button key={idx}>{s}</button>
        })
        return (
            <div>
                <h2>Starships</h2>
                {shipList}
            </div>
        )
    }
}

export default StarshipList
